div.script:
if (window.hljs) { hljs.configure({ languages: [] })
hljs.initHighlightingOnLoad() if (document.readyState &&
document.readyState === "complete") { window.setTimeout(function ()
{ hljs.initHighlighting() }, 0) } }

// add bootstrap table styles to pandoc tables function
bootstrapStylePandocTables() { $("tr.odd") .parent("tbody")
.parent("table") .addClass("table table-condensed") }
$(document).ready(function () { bootstrapStylePandocTables() })
